import styled from "styled-components";
import Announcement from "../components/announcement/Announcement";
import Navbar from "../components/navbar/Navbar";

const Container = styled.div``;
const ProductsList = () => {
  return (
    <Container>
      <Navbar />
      <Announcement />
    </Container>
  );
};

export default ProductsList;
